import { React, useState} from "react";
import Button from "../components/Button";
import Textbox from "../components/Textbox";

const Register=()=>{
    const [userData, setUserData]=useState(
            {
                fullName:'',
                dob:'',
                email:'',
                phone:'',
                password:'',
                cpassword:''
            })
    const inputDataChange=(event)=>{
        setUserData({...userData,[event.target.name]:[event.target.value]})
        console.log(event.target.value)
    }
    const signupStudent=()=>{
        console.log("signup button clicked. Navigating to Verify.js");
    }
    return(
        <div className="container-box cg-background-clr">
            <div className="topDiv">
                <h3>Hello! <br/> Sign up to get started.</h3>
            </div>
            <div className="bottomDiv">
                <form>
                    <Textbox label="Full name" name={userData.fullName} inputDataChange={inputDataChange}/>
                    <Textbox label="Email" name={userData.email} inputDataChange={inputDataChange}/>
                    <Textbox label="Phone" name={userData.phone} inputDataChange={inputDataChange}/>
                    <Textbox label="Date of Birth" name={userData.dob} inputDataChange={inputDataChange}/>
                    <Textbox label="Password" name={userData.password} inputDataChange={inputDataChange}/>
                    <Textbox label="Confirm password" name={userData.cpassword} inputDataChange={inputDataChange}/>
                    <Button name="signupBtn" label="Sign Up" onClick={signupStudent} />
                </form>
            </div>
        </div>
    )

}

export default Register;
